    var spotifyApi = new SpotifyWebApi();
    spotifyApi.setAccessToken("BQCcbVkIyE545BvoSukemeGeX-htdl3vC4Ted_vIaYgkiyk0mJjc9wUjuntf6OVTUKEHofGEygy1OZUfZ5UuRKwzV7AHjSYgfSYla8YBtbOsVN4cF6E");
    spotifyApi.getUserPlaylists().then((data) => console.log(data));

    return(
        <div>
            <h1>Hello!</h1>
        </div>
    );
}

